    state = {
        messageClassList: ['cookieDiv']
    }
    render(){
        return(
            <React.Fragment>
                <div className={this.state.messageClassList.join(' ')}>
                    {/* <img onClick={cookieToggle} src="/img/close.svg" alt="" /> */}
                    <img onClick={() => this.setState({messageClassList:['cookieDiv','cookieTrue']})} src="/img/close.svg" alt="" />
                    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.</p>
                </div>
            </React.Fragment>
        )
    }
}
